import React from "react";
import { Card } from "../../UI/Card.styled";
import { ImageCard } from "../../UI/ImageCard.styled";
const NavBar = ({ UI }) => {
  return (
    <Card
      mg={"1rem 7.5%"}
      height={"2rem"}
      width={"85%"}
      // bd={"1px solid red"}
      dp={"grid"}
      gridC={"25% 35% 40%"}
      //   ovfx={"hidden"}
    >
      <Card bd={"3px solid red"}>
        <ImageCard
          src={UI.userIcon}
          heigth={"1.6rem"}
          width={"1.6rem"}
          mg={"0rem 0rem -0.5rem 0rem"}
        />
        <Card mg={"0rem 0rem -0.8rem 0.4rem"} dp={"inline"}>
          Marvel
        </Card>
      </Card>
      <Card bd={"1px solid red"}></Card>
      <Card bd={"1px solid red"}></Card>
    </Card>
  );
};

export default NavBar;
